I am actually not super organized when it comes to my process and tools when working . This box of pencil crayons is what I worked with for this entire drawing, it sat next to me on a chair at the easel . I find even with the coloured pencils ( there are about 50 of them in consistent use for this piece ) my mind eventually knows what the colour will look like and the process of layering colours happens without even being truly conscious of it. The colours are layered directly on the paper , I donâ€™t have a piece of paper that I am testing on ( I did that very early on, this piece was my first coloured portrait ) , I think that is my inquisitive,  slightly impulsive nature , that just wants to be in the moment without planning and seeing the result . I find that especially in these large drawings that take months , I need things to stay exciting in the moment and doing things this way seems to keep things interesting. I am often asked how many pencil crayons I go through in a large drawing , in this case I didnâ€™t entirely  burn through a single one , some are nearing the end of their lives , but all are still useful for another project . I think that is kind of crazy when I think about it ğŸ¤”. â€˜Madeline â€˜ , Pencil Crayon, 2018 , Sarah Holtby 
